// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;
pragma abicoder v2;

import "@openzeppelin/contracts/token/ERC1155/ERC1155.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/Counters.sol";
import "./INFTFactory.sol";
import "./NextItem.sol";

contract NextPack is ERC1155, INFTFactory, Ownable {

    using Counters for Counters.Counter;
    Counters.Counter private _packIds;

    struct NPack {
        bool availableToUnpack;
        uint256 id;
        uint256[] itemIds;
        string metadata;
    }

    mapping(uint256 => NPack) private packs;
    mapping(address => bool) private _operators;

    address itemContract;
    NextItem private itemFactory;

    event NewPackMinted(
        address indexed sender,
        NPack pack,
        uint256 quantity
    );

    event PackMinted(
        address indexed sender,
        uint256 id,
        uint256 quantity
    );

    event PackItemUpdated(
        address indexed sender,
        uint256 id,
        uint256[] itemIds
    );

    event PackStatusUpdated(
        address indexed sender,
        uint256 id,
        bool availableToUnpack
    );

    event PackMetadataUpdated(
        address indexed sender,
        uint256 id,
        string metadata
    );

    event NextPackOperatorUpdated(
        address indexed sender,
        address operator,
        bool approved
    );

    event PackBurned(address indexed sender, uint256 id, uint256 quantity);

    event Unpacked(address indexed sender, uint256 id);

    constructor(string memory baseURI) ERC1155(baseURI) {
        _operators[msg.sender] = true;
        itemContract = address(0);
    }

    modifier isValidPackId(uint256 packId) {
        require(packId < _packIds.current(), "Invalid packId");
        _;
    }

    function updateOperator(address operator, bool approved)
        public
        onlyOwner
    {
        _operators[operator] = approved;
        emit NextPackOperatorUpdated(msg.sender, operator, approved);
    }

    function isOperator(address addr)
        public
        view
        returns (bool)
    {
        return _operators[addr];
    }

    function updateItemFactoryContract(address _itemContract)
        public
        onlyOwner
    {
        require(_itemContract != address(0), "itemContract must not be zero address");
        itemContract = _itemContract;
        itemFactory = NextItem(itemContract);
    }

    function allValidItems(uint256[] memory _itemIds)
        private
        view
        returns (bool)
    {
        require(itemContract != address(0), "itemContract must be set");
        uint256 maxId = itemFactory.getUniqueTokenNum();
        for (uint256 i = 0; i < _itemIds.length; i++) {
            if (_itemIds[i] >= maxId) return false;
        }
        return true;
    }

    function mintNewPack(NPack memory pack, uint256 quantity)
        public
        onlyOwner
    {
        require(allValidItems(pack.itemIds), "Pack contains invalid itemId");
        uint256 packId = _packIds.current();
        _packIds.increment();

        _mint(msg.sender, packId, quantity, "");
        pack.id = packId;
        packs[packId] = pack;

        emit NewPackMinted(msg.sender, pack, quantity);
    }

    function mintMorePack(uint256 packId, uint256 quantity)
        public
        onlyOwner
        isValidPackId(packId)
    {
        _mint(msg.sender, packId, quantity, "");
        emit PackMinted(msg.sender, packId, quantity);
    }

    function updatePackItems(uint256 packId, uint256[] memory _itemIds)
        public
        onlyOwner
        isValidPackId(packId)
    {
        require(allValidItems(_itemIds), "Pack contains invalid items");
        packs[packId].itemIds = _itemIds;
        emit PackItemUpdated(msg.sender, packId, _itemIds);
    }

    function updatePackStatus(uint256 packId, bool status)
        public 
        onlyOwner
        isValidPackId(packId)
    {
        packs[packId].availableToUnpack = status;
        emit PackStatusUpdated(msg.sender, packId, status);
    }

    function updatePackMetadata(uint256 packId, string memory metadata)
        public
        onlyOwner
        isValidPackId(packId)
    {
        packs[packId].metadata = metadata;
        emit PackMetadataUpdated(msg.sender, packId, metadata);
    }

    function uri(uint256 packId) public view override 
        isValidPackId(packId)
        returns (string memory)
    {
        return packs[packId].metadata;
    }

    function burnPack(uint256 packId, uint256 quantity)
        public 
        onlyOwner
        isValidPackId(packId)
    {
        _burn(msg.sender, packId, quantity);
        emit PackBurned(msg.sender, packId, quantity);
    }

    function getPack(uint256 packId)
        public
        view
        returns (NPack memory)
    {
        require(packId < _packIds.current(), "Invalid packId");
        return packs[packId];
    }

    function createBatchAmount(uint256 len)
        private
        pure
        returns (uint256[] memory)
    {
        uint256[] memory amounts = new uint256[](len);
        for (uint256 i = 0; i < len; i++) {
            amounts[i] = 1;
        }

        return amounts;
    }

    function unpack(uint256 packId)
        public
        isValidPackId(packId)
    {
        uint256 numberOfPacks = balanceOf(msg.sender, packId);
        require(numberOfPacks > 0, "Insufficient balance");

        NPack storage pack = packs[packId];
        require(pack.availableToUnpack == true, "Cannot unpack");

        uint256 numberOfItems = pack.itemIds.length;
        require(numberOfItems > 0, "Empty pack");

        uint256[] memory amounts = createBatchAmount(numberOfItems);

        _burn(msg.sender, packId, 1);
        itemFactory.mintBatch(msg.sender, pack.itemIds, amounts);

        emit Unpacked(msg.sender, packId);
    }

    function getUniqueTokenNum()
        public 
        view 
        virtual override 
        returns (uint256)
    {
        return _packIds.current();
    }
}
